import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';


function App() {

  const sisu = data.map(item => {
    return (
      <div>
        <h1> {item.name}</h1>
        <h1> {item.age}</h1>
        {item.img.map((img, index) => (
          <img key={index} src={img} alt={`${item.name}-${index}`} />
        ))
        }
      </div>


    );
  });
  const sisu2 = data.map(item => {
    return (
      <MainContent
        name={item.name}
        age={item.age}
      />
    )
  })


  return (
    <div className="App">
      <ul>
        <li>{sisu}</li>
        <li>{sisu2}</li>

      </ul>

    </div>
  );
}

export default App;
